  false,\n\t\"url\": null,\n\t\"notes\": \"The biannual fish survey was initiated
  in 1989 to monitor population trends of federally endangered fish species at Ash
  Meadows National Wildlife Refuge. Item 421 of the Draft Recovery Plan for the Endangered
  and Threatened Species of Ash Meadows, Nevada states that representative endangered
  fish populations should be monitored on a biannual basis. Six spring pools were
  initially selected due to their vulnerabilities, such as exposure to exotic fish
  species, tendency to become overgrown with terrestrial vegetation or their potential
  to become the focus of future recovery actions. These included Longstreet, Jackrabbit,
  Marsh, Crystal, South Scruggs and Bradford Springs.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
